import React from 'react';
import './App.css';
import EditButton from './components/editButton';
import Pad from './components/pad.jsx';
import DesignPad from './components/designPad.jsx';

function App() {
  return (
    <div className="App">
        <EditButton />
        <div style={{display: 'flex', justifyContent: 'spaceBe'}}>
          <Pad />
          <DesignPad />
        </div>

    </div>
  );
}

export default App;
